INSERT INTO `contact_triggers` VALUES (1,1,3,'3 sessions remaining',0,0,1,0,'',0,'3 sessions remaining','$FirstName$ $LastName$ is currently enrolled onto our $Level$ class on a $Time$. \n\nWe have noticed from our records that your payment is due to expire on $CurrentEndDate$. To make sure that $FirstName$ retains their space, we now require a payment of $Cost$ to be made. \n\nThis payment can be made online using HomePortal, by clicking the below link:\n\nhttp://homeportal.coursepro.co.uk \n\nIf you have not yet registered for HomePortal, please click this link:\n\nhttp://homeportal.coursepro.co.uk/register\n\nYou will require $FirstName$\'s Membership Card Number as the username. $FirstName$\'s Membership Card Number is $CardNo$.\n\nWe look forward to hearing from you. \n\nBest wishes,\n\n$Centre$\n$Centre_Telephone$','','2019-03-14 09:42:36','2019-03-14 09:42:36',1,0,'2019-03-14 09:42:36',1,1),(2,2,0,'Course Enrolment',0,0,1,0,'',0,'Welcome to our Course','Thank you for enrolling onto swimming lessons at $Centre$. \n\n$FirstName$ $LastName$ has been enrolled into $Level$ on a $Time$.\n\nThe first session will be on $StartDate$ and the final session will be on $EndDate$ (inclusive). Please note, if you are paying by direct debit, you will not be provided with an end date. \n\nThere may be cancelled sessions during your Course (normally due to a Bank Holiday). These sessions will appear below:\n\n$Cancelled$\n\nShould you have any cancelled sessions your end date will be extended, for example you pay for ten sessions which includes one bank holiday. Your ten sessions will be extended by one session to make up for this. \n\nFinally, you are now able to view progress and make payments via HomePortal. To register, please click the following link:\n\nhttp://homeportal.coursepro.co.uk/register\n\nYou will require $FirstName$\'s Membership Card Number, which is $CardNo$ along with $FirstName$\'s date of birth and post code. \n\nIf you have any problems, please do not hesitate to contact our Reception team on $Centre_Telephone$, who will contact you via email or phone when your next payment is due. \n\nBest wishes,\n\n$Centre$\n$Centre_Telephone$','','2019-03-14 09:42:36','2019-03-14 09:42:36',1,0,'2019-03-14 09:42:36',1,1),(3,3,0,'Re-Enrolment',0,0,1,0,'',0,'Thank you for continuing with us','Thank you for re-enrolling onto $FirstName$ $LastName$\'s Swimming Lessons.\n\nWe can confirm that $FirstName$ will swim on $Time$ at $Class$. Your class expiry date is now $EndDate$ (inclusive) and we will contact you before this date to remind you of your next payment. \n\nWe will contact you when $FirstName$ is ready to move to the next level. You can view progress online using HomePortal. This can be accessed at the below link:\n\nhttp://homeportal.coursepro.co.uk\n\nYou will require $FirstName$\'s Membership Card Number as Username. $FirstName$\'s Buzz Card Number is $CardNo$.\n\nPlease do not hesitate to contact a member of the Reception Team if you require any further assistance. \n\nBest wishes,\n\n$Centre$\n$Centre_Telephone$','','2019-03-14 09:42:36','2019-03-14 09:42:36',1,0,'2019-03-14 09:42:36',1,1),(4,5,0,'Marked for movement',0,0,1,0,'',0,'Course Movement','Dear $FirstName$,\n  \nCongratulations!  You are now ready to move up to the next stage of your course.  Go to http://homeportal.coursepro.co.uk/ to look at the available classes and choose the day and time which suits you best. If you have any questions, please contact us directly.\n\nThank you\n\n$Centre$\n$Centre_Telephone$','','2019-03-14 09:42:36','2019-03-14 09:42:36',1,0,'2019-03-14 09:42:36',1,1),(5,6,0,'Movement Confirmation',0,0,1,0,'',0,'Confirmation of Movement','Thank you for requesting to move up to the next level of your course, your request has been successfully processed.  \n\nYour last class at your current stage is on: $OldEndDate$, $OldTime$  Your new stage starts on: $StartDate$, $Time$  \n\nIf you have any questions, please contact the Centre directly.  \n\nThank you.\n\n$Centre$\n$Centre_Telephone$','','2019-03-14 09:42:36','2019-03-14 09:42:36',1,0,'2019-03-14 09:42:36',1,1),(6,10,0,'Payment Confirmation',0,0,1,0,'',0,'Thank you for your payment','Thank you for your payment of $Amount$. Your booking is now complete, please do not hesitate to contact us if you have any questions.\n\nKind regards,\n\n$Centre$\n$Centre_Telephone$','','2019-03-14 09:42:36','2019-03-14 09:42:36',1,0,'2019-03-14 09:42:36',1,1),(7,9,0,'Badge Awarded',0,0,1,0,'',0,'Congratulations, you\'ve been awarded a badge!','Congratulations. $FirstName$ has achieved a $BadgeName$ badge within their $Level$ class. \n\nPlease contact Reception or a member of staff to purchase. Well done $FirstName$!\n\nBest wishes,\n\n$Centre$\n$Centre_Telephone$','','2019-03-14 09:42:36','2019-03-14 09:42:36',1,0,'2019-03-14 09:42:36',1,1),(8,11,0,'Request for Payment',0,0,1,0,'',0,'Your Booking Invoice','Dear Parent/Guardian\n\nINVOICE\n\nYour space has been held and we are now awaiting payment. \n\nPlease refer to your welcome email for details of the course.\n\nCourse Fees now Due: GBP $Amount$\n\nPlease note, your booking is not confirmed until payment has been received.\n\nPayment is due within 5 working days or prior to the start of the first class if sooner.\n\nPayment can be made by card over the telephone.\n\nA confirmation of booking will be sent separately once payment has been received.\n\nPrices include VAT\n\nThank you\n\n$Centre$\n$Centre_Telephone$','','2019-03-14 09:42:36','2019-03-14 09:42:36',1,0,'2019-03-14 09:42:36',1,1),(9,8,0,'Confirmation of Movement',0,0,1,0,'',0,'Confirmation of Movement','Thank you for requesting to move up to the next level of your course, your request has been successfully processed.  \n\nYour last class at your current stage is on: $OldEndDate$, $OldTime$  Your new stage starts on: $StartDate$, $Time$  \n\nIf you have any questions, please contact the Centre directly.  \n\nThank you.\n\n$Centre$\n$Centre_Telephone$','','2019-03-14 09:42:36','2019-03-14 09:42:36',1,0,'2019-03-14 09:42:36',1,1),(10,13,0,'Marked for movement (no HomePortal)',0,0,1,0,'',0,'Course Movement','Dear $FirstName$,\n \nCongratulations!  You are now ready to move up to the next stage of your course.  Please contact us to consider the available classes and choose the day and time which suits you best.  If you have any questions, please contact the Centre directly.\n\nThank you\n\n$Centre$\n$Centre_Telephone$','','2019-03-14 09:42:36','2019-03-14 09:42:36',1,0,'2019-03-14 09:42:36',1,1);
/*!40000 ALTER TABLE `contact_triggers` ENABLE KEYS */;
UNLOCK TABLES;

