INSERT INTO `course_competencies` VALUES (1,1,'1. Enter the water safely','1. Enter the water safely',1,1,'2019-03-14 09:42:13',6,1,'eb90052a89061e4d63b300b2ccd5bdeca6d7b66e'),(2,1,'2. Move / paddle forwards 5 meters face down in the water','2. Move / paddle forwards 5 meters face down in the water',1,2,'2019-03-14 09:42:13',6,1,'eb90052a89061e4d63b300b2ccd5bdeca6d7b66e'),(3,1,'3. Move / paddle backwards 5 meters','3. Move / paddle backwards 5 meters',1,3,'2019-03-14 09:42:13',6,1,'eb90052a89061e4d63b300b2ccd5bdeca6d7b66e'),(4,1,'4. Move sideways 5 meters','4. Move sideways 5 meters',1,4,'2019-03-14 09:42:13',6,1,'eb90052a89061e4d63b300b2ccd5bdeca6d7b66e'),(5,1,'5. Scoop water and wash face','5. Scoop water and wash face',1,5,'2019-03-14 09:42:13',6,1,'eb90052a89061e4d63b300b2ccd5bdeca6d7b66e'),(6,1,'6. Be at ease with water showered from over head','6. Be at ease with water showered from over head',1,6,'2019-03-14 09:42:13',6,1,'eb90052a89061e4d63b300b2ccd5bdeca6d7b66e'),(7,1,'7. Move into a stretched floating position using aids, equipment or support - must obtain a flat body position','7. Move into a stretched floating position using aids, equipment or support - must obtain a flat body position',1,7,'2019-03-14 09:42:13',6,1,'eb90052a89061e4d63b300b2ccd5bdeca6d7b66e'),(8,1,'8. Regain an upright position from on the back with support','8. Regain an upright position from on the back with support',1,8,'2019-03-14 09:42:13',6,1,'eb90052a89061e4d63b300b2ccd5bdeca6d7b66e'),(9,1,'9. Regain an upright position from on the front with support','9. Regain an upright position from on the front with support',1,9,'2019-03-14 09:42:13',6,1,'eb90052a89061e4d63b300b2ccd5bdeca6d7b66e'),(10,1,'10. Push and glide in a flat horizontal position to or from a wall','10. Push and glide in a flat horizontal position to or from a wall',1,10,'2019-03-14 09:42:13',6,1,'eb90052a89061e4d63b300b2ccd5bdeca6d7b66e'),(11,1,'11. Take part in a teacher led partner orientated game','11. Take part in a teacher led partner orientated game',1,11,'2019-03-14 09:42:13',6,1,'eb90052a89061e4d63b300b2ccd5bdeca6d7b66e'),(12,1,'12. Demonstrate an understanding of pool rules ','12. Demonstrate an understanding of pool rules ',1,12,'2019-03-14 09:42:13',6,1,'eb90052a89061e4d63b300b2ccd5bdeca6d7b66e'),(13,1,'13. Exit the water safely ','13. Exit the water safely ',1,13,'2019-03-14 09:42:13',6,1,'eb90052a89061e4d63b300b2ccd5bdeca6d7b66e'),(14,2,'1. Jump in from poolside safely','1. Jump in from poolside safely',1,1,'2019-03-14 09:42:13',6,1,'eb90052a89061e4d63b300b2ccd5bdeca6d7b66e'),(15,2,'2. Blow bubbles a minimum of 3 times rhythmically with nose and mouth submerged. ','2. Blow bubbles a minimum of 3 times rhythmically with nose and mouth submerged. ',1,2,'2019-03-14 09:42:13',6,1,'eb90052a89061e4d63b300b2ccd5bdeca6d7b66e'),(16,2,'3. Regain an upright position from the back without support.','3. Regain an upright position from the back without support.',1,3,'2019-03-14 09:42:13',6,1,'eb90052a89061e4d63b300b2ccd5bdeca6d7b66e'),(17,2,'4. Regain an upright position from the front without support.','4. Regain an upright position from the front without support.',1,4,'2019-03-14 09:42:13',6,1,'eb90052a89061e4d63b300b2ccd5bdeca6d7b66e'),(18,2,'5. Push from wall and glide on the back.','5. Push from wall and glide on the back.',1,5,'2019-03-14 09:42:13',6,1,'eb90052a89061e4d63b300b2ccd5bdeca6d7b66e'),(19,2,'6. Push from wall and glide on the front.','6. Push from wall and glide on the front.',1,6,'2019-03-14 09:42:13',6,1,'eb90052a89061e4d63b300b2ccd5bdeca6d7b66e'),(20,2,'7. Travel on the back in a flat body position with basic arm pull for 5 metres.','7. Travel on the back in a flat body position with basic arm pull for 5 metres.',1,7,'2019-03-14 09:42:13',6,1,'eb90052a89061e4d63b300b2ccd5bdeca6d7b66e'),(21,2,'8. Travel on the front in a flat body position with basic arm pull for 5 metres.','8. Travel on the front in a flat body position with basic arm pull for 5 metres',1,8,'20