th alternate hands, and lift above head. Repeat 10 times.',1,4,'2019-03-14 09:42:13',18,1,'eb90052a89061e4d63b300b2ccd5bdeca6d7b66e'),(130,14,'5. Pass and catch a ball accurately with a partner, over a 3m distance, 10 times each, using one hand only.','5. Pass and catch a ball accurately with a partner, over a 3m distance, 10 times each, using one hand only.',1,5,'2019-03-14 09:42:13',18,1,'eb90052a89061e4d63b300b2ccd5bdeca6d7b66e'),(131,14,'6. Pick up a ball, shoot at target (like a kick board/bottle) from a 2m distance and repeat 5 times.','6. Pick up a ball, shoot at target (like a kick board/bottle) from a 2m distance and repeat 5 times.',1,6,'2019-03-14 09:42:13',18,1,'eb90052a89061e4d63b300b2ccd5bdeca6d7b66e'),(132,14,'7. Play an advanced mini-polo game with at least 5 vs 5 using the skills learnt, showing good technique throughout and a basic awareness of game play.','7. Play an advanced mini-polo game with at least 5 vs 5 using the skills learnt, showing good technique throughout and a basic awareness of game play.',1,7,'2019-03-14 09:42:13',18,1,'eb90052a89061e4d63b300b2ccd5bdeca6d7b66e'),(133,15,'1. Swim 5m Synchro Breaststroke then 5m Synchro Backstroke using a smooth transition.','1. Swim 5m Synchro Breaststroke then 5m Synchro Backstroke using a smooth transition.',1,1,'2019-03-14 09:42:13',18,1,'eb90052a89061e4d63b300b2ccd5bdeca6d7b66e'),(134,15,'2. Move from back layout to bent knee, then lift to ballet leg using buoyancy aid / use pool to support horizontal leg.','2. Move from back layout to bent knee, then lift to ballet leg using buoyancy aid / use pool to support horizontal leg.',1,2,'2019-03-14 09:42:13',18,1,'eb90052a89061e4d63b300b2ccd5bdeca6d7b66e'),(135,15,'3. Hold an inverted pike position using buoyancy aid.','3. Hold an inverted pike position using buoyancy aid.',1,3,'2019-03-14 09:42:13',18,1,'eb90052a89061e4d63b300b2ccd5bdeca6d7b66e'),(136,15,'4. Back tuck somersault.','4. Back tuck somersault.',1,4,'2019-03-14 09:42:13',18,1,'eb90052a89