 to bent knee and return to back layout - 5m.',1,5,'2019-03-14 09:42:13',6,1,'eb90052a89061e4d63b300b2ccd5bdeca6d7b66e'),(153,17,'6. Perform Marlin (1/4 turn). ','6. Perform Marlin (1/4 turn). ',1,6,'2019-03-14 09:42:13',6,1,'eb90052a89061e4d63b300b2ccd5bdeca6d7b66e'),(154,17,'7. Head first entry, surface demonstrating eggbeater.','7. Head first entry, surface demonstrating eggbeater.',1,7,'2019-03-14 09:42:13',6,1,'eb90052a89061e4d63b300b2ccd5bdeca6d7b66e'),(155,17,'8. Perform a sequence for 45 - 60 seconds, to music with a partner or group, starting with foot first entry and including at least 2 strokes, eggbeater & 2 figures.','8. Perform a sequence for 45 - 60 seconds, to music with a partner or group, starting with foot first entry and including at least 2 strokes, eggbeater & 2 figures.',1,8,'2019-03-14 09:42:13',6,1,'eb90052a89061e4d63b300b2ccd5bdeca6d7b66e'),(156,18,'1. Swim 20m head up Front Crawl with the ball.','1. Swim 20m head up Front Crawl with the ball.',1,1,'2019-03-14 09:42:13',6,1,'eb90052a89061e4d63b300b2ccd5bdeca6d7b66e'),(157,18,'2. 10 static pick up rotations with the ball using alternate hands.','2. 10 static pick up rotations with the ball using alternate hands.',1,2,'2019-03-14 09:42:13',6,1,'eb90052a89061e4d63b300b2ccd5bdeca6d7b66e'),(158,18,'3. Swim 20m head up Front Crawl, turn at 10m without using a wall/floor and return to starting point.','3. Swim 20m head up Front Crawl, turn at 10m without using a wall/floor and return to starting point.',1,3,'2019-03-14 09:42:13',6,1,'eb90052a89061e4d63b300b2ccd5bdeca6d7b66e'),(159,18,'4. Swim 20m head up Front Crawl, change into vertical, static, eggbeater and hold for 5 seconds.  Repeat 6 times.','4. Swim 20m head up Front Crawl, change into vertical, static, eggbeater and hold for 5 seconds.  Repeat 6 times.',1,4,'2019-03-14 09:42:13',6,1,'eb90052a89061e4d63b300b2ccd5bdeca6d7b66e'),(160,18,'5. Move 5m forwards, 5m backwards, 5m left and 5m right and return to starting point, using eggbeater kick and staying vertical.  Keep elbows out of the water.','5. Move 5m forwards, 5m backwards, 5m left and 5m right and return to starting point, using eggbeater kick and staying vertical.  Keep elbows out of the water.',1,5,'2019-03-14 09:42:13',6,1,'eb90052a89061e4d63b300b2ccd5bdeca6d7b66e'),(161,18,'6. Use eggbeater kick and sculling to stay horizontal/flat on the surface and then move 10m forwards. Demonstrate ability to be as high as possible on top of the water.','6. Use eggbeater kick and sculling to stay horizontal/flat on the surface and then move 10m forwards. Demonstrate ability to be as high as possible on top of water.',1,6,'2019-03-14 09:42:13',6,1,'eb90052a89061e4d63b300b2ccd5bdeca6d7b66e'),(162,18,'7. Pass and catch a ball accurately with partner, over a 3m  distance, using one hand 10 times then the other hand 10 times.','7. Pass and catch a ball  accurately with partner, over a 3m  distance, using one hand 10 times then the other hand 10 times.',1,7,'2019-03-14 09:42:13',6,1,'eb90052a89061e4d63b300b2ccd5bdeca6d7b66e'),(163,18,'8. Pick up a ball, shoot at a target (kick board/bottle etc)  from 3m distance x 5 times','8. Pick up a ball, shoot at a target (kick board/bottle etc)  from 3m distance x 5 times.',1,8,'2019-03-14 09:42:13',6,1,'eb90052a89061e4d63b300b2ccd5bdeca6d7b66e'),(164,18,'9. Play a Water polo game for 4 x 5 mins.  Incorporate all skills learnt - good technique.','9. Play a Water polo game for 4 x 5 mins.  Incorporate all skills learnt - good technique.',1,9,'2019-03-14 09:42:13',6,1,'eb90052a89061e4d63b300b2ccd5bdeca6d7b66e'),(165,19,'1. Forward jump straight, with arm swing.','1. Forward jump straight, with arm swing.',1,1,'2019-03-14 09:42:13',6,1,'eb90052a89061e4d63b300b2ccd5bdeca6d7b66e'),(166,19,'2. Forward jump tuck, with arm swing.','2. Forward jump tuck, with arm swing.',1,2,'2019-03-14 09:42:13',6,1,'eb90052a89061e4d63b300b2ccd5bdeca6d7b66e'),(167,19,'3. Crouch forward dive with hands grabbed above head to start.','3. Crouch forward dive with hands grabbed above head to start.',1,3,'2019-03-14 09:42:13',6,1,'eb90052a89061e4d63b300b2ccd5bdeca6d7b66e'),(168,19,'4. Push and Glide on the back followed by back circle.','4. Push and Glide on the back followed by back circle.',1,4,'2019-03-14 09:42:13',6,1,'eb90052a89061e4d63b300b2ccd5bdeca6d7b66e'),(169,19,'5. Back tuck roll from poolside.','5. Back tuck roll from poolside.',1,5,'2019-03-14 09:42:13',6,1,'eb90052a89061e4d63b300b2ccd5bdeca6d7b66e'),(170,19,'6. Back jump tuck.','6. Back jump tuck.',1,6,'2019-03-14 09:42:13',6,1,'eb90052a89061e4d63b300b2ccd5bdeca6d7b66e'),(171,20,'Rally of 5 on the f/h or b/h with a coach / adult (player must hit 5 shots)','Coach/Adult feeds ball underarm to start the rally and rallies with the player until the player has hit 5 forehands or backhands.\n\nEach player has 3 attempts to achieve the rally.',1,1,'2019-03-14 09:42:13',152,NULL,NULL),(172,20,'Using abbreviated overarm action bump 5 serves in out of 10. 1/2 way between service line and net.','Player is half way between the net and service line, using an abbreviated overarm action bump 5 serves in out of 10.\n\nPlayer must make contact above their head.',1,2,'2019-03-14 09:42:13',152,NULL,NULL),(173,20,'Player moves to the net to make 5/10 volleys over and in. (f/h,b/h)','Player starts on service line, moves to the net to make 5/10 forehand and backhand volleys over and in.\n\nThe player needs to be in a ready position everytime.',1,3,'2019-03-14 09:42:13',152,NULL,NULL),(174,20,'Can play 5 point tie-break in short court, with abbreviated serve.','Can play 5 point tie-break in short court. Player must understand when the ball is in or out, and when it has bounced twice.\n\nPlayer must have a British Tennis Membership (BTM)\nTo sign up go to www.lta.org.uk/membership.',1,4,'2019-03-14 09:42:13',152,NULL,NULL),(175,21,'Rally to 10 (f/h or b/h) with another player. From service line.','Players can rally to 10 with another player. They must get back into a ready position after each shot. begining to develop a swing.\n\nPlayers will have three attempts.',1,1,'2019-03-14 09:42:13',152,NULL,NULL),(176,21,'7/10 serves in from the service line.','Player must achieve 7/10 serves in from the service line.\n\nPlayer will show understanding of the service action but can start from \"tick\" position.\n\nPlayer should be using somewhere close to an eastern grip.',1,2,'2019-03-14 09:42:13',152,NULL,NULL),(178,21,'Approach and volley, 7/10.','Player starts on service line, hits an approach shot and comes to the net to play a volley.\n\nPlayer must move quickly to the net and be in a ready position everytime.\n\nPlayer must complete this 7/10 times.\n\nPlayer must make 7/10.',1,3,'2019-03-14 09:42:13',152,NULL,NULL),(179,21,'Play a tie-break from service line.','Player must be able to play a tie break against another player from the service line starting with a serve.\n\nPlayer must have a British Tennis Membership (BTM)\nTo sign up go to www.lta.org.uk/membership.',1,4,'2019-03-14 09:42:13',152,NULL,NULL),(180,22,'Rally of 15 or more with another player.','Player must make a Rally of 15 shots or more with another Red Level 1 child, from the baseline. Player has three attempts.\n\nPlayer should be consistently starting and recovering into a ready position.\n\nPlayer should have a smooth swing with racket finishing over shoulder.',1,1,'2019-03-14 09:42:13',152,NULL,NULL),(181,22,'Be able to serve 1st & 2nd serve overarm within the court. 7/10.','Player must be able to serve 1st & 2nd serve; overarm, and land cross court in the correct box.\n\nPlayer has 10 serves and must get 7 in.\n\nPlayer must serve with over arm throwing action, and maintain balance throughout.',1,2,'2019-03-14 09:42:13',152,NULL,NULL),(182,22,'Play an approach shot, come to the net and make two volleys. 7/10','Player must play an approach shot, come to the net and play two volleys. They must make 7/10 sets of all three shots.\n\nAfter hitting the approach player needs to quickly get to the net and split step into a ready positon. They must then make two volleys with a short forward push of the racket, recovering back into ready position.',1,3,'2019-03-14 09:42:13',152,NULL,NULL),(183,22,'Be able to play a full tie break.','The player must be able to play a full tie break to 10 on the full red court.\n\nTo complete the exercise the player has to spin racket and choose to serve or recieve, serve from the correct side throughout, call the balls in or out, call out the score and give the result to the coach at the end of the match.\n\nPlayer must have a British Tennis Membership (BTM)\nTo sign up go to www.lta.org.uk/membership.',1,4,'2019-03-14 09:42:13',152,NULL,NULL),(184,23,'Rally to 10 from service line.','The player must be able to rally to 10 with another player from the service line. From three attempts.\n\nThe player must use a smooth low to high swing trying to achieve a consistent contact point, and be always waiting and recovering into a ready position.',1,1,'2019-03-14 09:42:13',152,NULL,NULL),(185,23,'Serve 7/10 from cross court from the service line.','Player must be able to serve 7/10 cross court from the service line. Within 3 attempts.\n\nThe player must serve from a balanced position making sure that contact is above their head. They must also keep their feet still.',1,2,'2019-03-14 09:42:13',152,NULL,NULL),(186,23,'Approach the net  and Volley 7/10.','Player starts on service line, hits an approach shot and comes to the net to play a volley and achieve 7/10.\n\nPlayer must move quickly to the net and be in a ready position everytime.',1,3,'2019-03-14 09:42:13',152,NULL,NULL),(187,23,'Play a tie break in the service boxes.','The player must be able to play a tie break in the service boxes to 7 points.\n\nThe player must undertand the basic rules including the ball landing in or out, two chances for serving and the ball double bouncing.\n\nPlayer must have a British Tennis Membership (BTM)\nTo sign up go to www.lta.org.uk/membership.',1,4,'2019-03-14 09:42:13',152,NULL,NULL),(188,24,'Rally to 15 with another player from baseline.','The player must be able to rally to 15 with another player from the baseline. They will get 3 attempts.\n\nPlayers must be consistently starting and recovering into a ready position. They must be hitting with a smooth swing with the racket finishing over their shoulder. ',1,1,'2019-03-14 09:42:13',152,NULL,NULL),(189,24,'Serve 7/10 in from the baseline.','The player must serve 7/10 cross court and into the service box.\n\nThe player must be looking at recovering back into a ready position. They will have three attempts to do this.',1,2,'2019-03-14 09:42:13',152,NULL,NULL),(190,24,'Approach shot and two volleys. 7/10','Player starts just inside the baseline, moves forward to hit an approach shot, comes to the net to play two volleys. They must achieve 7/10.\n\nPlayer must move quickly to the net and be in a ready position everytime. They player will be challenged by wider and varied feeds.',1,3,'2019-03-14 09:42:13',152,NULL,NULL),(191,24,'Can play tie-break on a full orange court.','The player must be able to play either a best of 3 tie-break sets, or a 15 minute timed match.\n\nPlayer must have a British Tennis Membership (BTM) \nTo sign up go to www.lta.org.uk/membership.',1,4,'2019-03-14 09:42:13',152,NULL,NULL),(192,25,'Rally to 20 cross court.','Player must be able to rally with another player cross court to 20.\n\nThe player must be able to keep a consistent swing shape with the racket finishing over their shoulder. They must position themselves early behind the ball so they can maintain a consistent contact point.\n\nThey must also start and recover into a ready position every time.',1,1,'2019-03-14 09:42:13',152,NULL,NULL),(193,25,'Serve 7/10 in from the baseline.','The player must serve 7/10 serves in from the baseline.\n\nThey must maintain good balance and posture throughout the exercise. The player must be starting to develop a smooth throwing action, and be looking to use the correct continental grip.',1,2,'2019-03-14 09:42:13',152,NULL,NULL),(194,25,'Approach the net, play 2 volleys and a smash. 20/25 shots.','The player must start just inside the baseline, play and approach shot and move quickly to the net, they must play to vollies and a smash. Looking to make 20/25 shots.\n\nThe volley should be a short punching action, and contact on the smash should be above the head.\n\nThey should be recovering into a ready postion after each shot.',1,3,'2019-03-14 09:42:13',152,NULL,NULL),(195,25,'Be able to play a full tie break on full court.','The player must be able to play either a best of 3 tie-break sets, or a 15 minute timed match.\n\nTo complete the exercise the player has to spin racket and choose to serve or receive, serve from the correct side throughout, call the balls in or out, call out the score and give the result to the coach at the end of the match.\n\nPlayer must have a British Tennis Membership (BTM) \nTo sign up go to www.lta.org.uk/membership.',1,4,'2019-03-14 09:42:13',152,NULL,NULL),(196,26,'Rally to 10/15/20 from the baseline.','Player must be able to rally with another player to 10/15/20. (depending on ability)\n\nThe player must be able to keep a consistent swing shape with the racket finishing over their shoulder. They must position themselves early behind the ball so they can maintain a consistent contact point.\n\nThey must also start and recover into a ready position every time.',1,1,'2019-03-14 09:42:13',152,NULL,NULL),(197,26,'Serve from baseline 7/10','The player must serve 7/10 serves in from the baseline.\n\nThey must maintain good balance and posture throughout the exercise. The player must be starting to develop a smooth throwing action, and be looking to use the correct continental grip.',1,2,'2019-03-14 09:42:13',152,NULL,NULL),(198,26,'Approach the net two volleys and smash. 10/16','The player must start just inside the baseline, play and approach shot and move quickly to the net, they must play to vollies and a smash. Looking to make 10/16 shots.\n\nThe volley should be a short punching action, and contact on the smash should be above the head.\n\nThey should be recovering into a ready postion after each shot.',1,3,'2019-03-14 09:42:13',152,NULL,NULL),(199,26,'Play a match using full scoring system.','Player must be able to play a timed match, using the full scoring system (15/30/40/deuce/advantage).\n\nTo complete the exercise the player has to spin racket and choose to serve or recieve, serve from the correct side throughout, call the balls in or out, call out the score and give the result to the coach at the end of the match.\n\nPlayer must have a British Tennis Membership (BTM)\nTo sign up go to www.lta.org.uk/membership.',1,4,'2019-03-14 09:42:13',152,NULL,NULL);
