INSERT INTO `course_levels` VALUES (1,7,'Stage 1',0,0,0,0,'Developing safety awareness within a \"class\" scenario. Basic movement and swimming skills are taught along with water confidence.',1,'2019-03-14 09:42:12',1,1,'eb90052a89061e4d63b300b2ccd5bdeca6d7b66e',1),(2,42,'Stage 2',0,0,0,0,'Developing safe entries, including jumping in, basic floating, travelling on front and back plus rotating to regain upright postions.',1,'2019-03-14 09:42:12',1,1,'eb90052a89061e4d63b300b2ccd5bdeca6d7b66e',1),(3,17,'Stage 3',0,0,0,0,'Developing submersion, travelling on the front and back, rotation skills and water safety knowledge.',1,'2019-03-14 09:42:12',1,1,'eb90052a89061e4d63b300b2ccd5bdeca6d7b66e',1),(4,25,'Stage 4',0,0,0,0,'Developing the understanding of buoyancythrough a range of skills. Refining kicking techniques for all strokes.',1,'2019-03-14 09:42:13',1,1,'eb90052a89061e4d63b300b2ccd5bdeca6d7b66e',1),(5,30,'Stage 5',0,0,0,0,'Developing \"waterman-ship\" through sculling, treading, water skills and rotations. Stroke performance develops for all four strokes.',1,'2019-03-14 09:42:13',1,1,'eb90052a89061e4d63b300b2ccd5bdeca6d7b66e',1),(6,39,'Stage 6',0,0,0,0,'Developing effective swimming skills including co-ordinated breathing across all strokes and swimming 25m. Awareness of water safety aspects and an understanding of the importance of preparation for exercise.',1,'2019-03-14 09:42:13',1,1,'eb90052a89061e4d63b300b2ccd5bdeca6d7b66e',1),(7,42,'Stage 7',0,0,0,0,'Developing quality stroke technique up to 100m.',1,'2019-03-14 09:42:13',1,1,'eb90052a89061e4d63b300b2ccd5bdeca6d7b66e',1),(8,8,'Stage 8',0,0,0,0,'Once the core range of skills are learnt the young person will be offered Aquatic Development swimming training. This will also also incorporate sessions of water polo, diving, synchronised swimming and rookie lifesaving.',1,'2019-03-14 09:42:13',1,1,'eb90052a89061e4d63b300b2ccd5bdeca6d7b66e',1),(9,15,'Stage 9',0,0,0,0,'Once a core range of skills are learnt the young person will be offered competitive swimming training. This will also incorporate sessions of water polo, diving, synchronised swimming and rookie lifeguarding.',1,'2019-03-14 09:42:13',1,1,'eb90052a89061e4d63b300b2ccd5bdeca6d7b66e',1),(10,4,'Stage 10',0,0,0,0,'Once the core range of skills are learnt the young person will be offered Aquatic Development training. This will also incorpoate sessions of water polo, diving, synchronised swimming and rookie lifesaving.',1,'2019-03-14 09:42:13',1,1,'eb90052a89061e4d63b300b2ccd5bdeca6d7b66e',1),(11,0,'Red Level 3 (5)',0,0,0,0,'Beginners age 5-8yrs',1,'2019-03-14 09:42:13',152,NULL,NULL,NULL),(12,0,'Red Level 2 (10)',0,0,0,0,'Improvers 5-8 years',1,'2019-03-14 09:42:13',152,NULL,NULL,NULL),(13,0,'Red Level 1 (15/20)',0,0,0,0,'Top Group Age 5-8yrs',1,'2019-03-14 09:42:13',152,NULL,NULL,NULL),(14,0,'Orange Level 3 (10)',0,0,0,0,'',1,'2019-03-14 09:42:13',152,NULL,NULL,NULL),(15,0,'Orange Level 2 (15)',0,0,0,0,'',1,'2019-03-14 09:42:13',152,NULL,NULL,NULL),(16,0,'Orange Level 1 (20)',9,0,0,0,'Must be 9 years of age or older to move to Green (in-line with LTA guidelines)',1,'2019-03-14 09:42:13',152,NULL,NULL,NULL),(17,0,'Green Tennis (10/15/20)',0,0,0,0,'Age 10-12yrs',1,'2019-03-14 09:42:13',152,NULL,NULL,NULL);
