INSERT INTO `trigger_actions` VALUES (1,NULL,1,1,0,1,'3 sessions remaining','<p>Dear<strong>&nbsp;{{Member.FirstName}}</strong></p>	<p>Our course records for&nbsp;<strong>{{Course.Name}} -&nbsp;{{Course.Description}}</strong>&nbsp;show that you have&nbsp;<strong>{{ClassMember.SessionsLeft}}</strong>&nbsp;sessions remaining in&nbsp;<strong>{{Class.Name}}</strong>&nbsp;on<strong>&nbsp;{{Class.Day}}</strong>&nbsp;at&nbsp;<strong>{{Class.Time}}</strong>.</p>	<p>You can also renew online at&nbsp;<strong>{{Homeportal.Address}}</strong>.</p>	<p>Kind regards,</p>	<p>Reception</p>','',0,NULL,1,1),(2,NULL,1,2,0,1,'2 sessions remaining','<p>Dear<strong>&nbsp;{{Member.FirstName}}</strong></p>	<p>Our course records for&nbsp;<strong>{{Course.Name}} -&nbsp;{{Course.Description}}</strong>&nbsp;show that you have&nbsp;<strong>{{ClassMember.SessionsLeft}}</strong>&nbsp;sessions remaining in&nbsp;<strong>{{Class.Name}}</strong>&nbsp;on<strong>&nbsp;{{Class.Day}}</strong>&nbsp;at&nbsp;<strong>{{Class.Time}}</strong>.</p>	<p>You can also renew online at&nbsp;<strong>{{Homeportal.Address}}</strong>.</p>	<p>Kind regards,</p>	<p>Reception</p>','',0,NULL,1,1),(3,NULL,1,3,0,1,'1 session remaining','<p>Dear<strong>&nbsp;{{Member.FirstName}}</strong></p>	<p>Our course records for <strong>{{Course.Name}} -&nbsp;{{Course.Description}}</strong> show that you have <strong>{{ClassMember.SessionsLeft}}</strong>&nbsp;sessions remaining in&nbsp;<strong>{{Class.Name}}</strong> on<strong>&nbsp;{{Class.Day}}</strong> at <strong>{{Class.Time}}</strong>.</p>	<p>You can also renew online at&nbsp;<strong>{{Homeportal.Address}}</strong>.</p>	<p>Kind regards,</p>	<p>Reception</p>','',0,NULL,1,1),(4,NULL,1,4,0,1,'Welcome to class','<p>Dear&nbsp;<strong>{{Member.FirstName}}</strong></p>	<p>You are now booked on&nbsp;<strong>{{Class.Name}} </strong>on<strong>&nbsp;{{Class.Day}}</strong> at&nbsp;<strong>{{Class.Time}}</strong>.</p>	<p>Your teacher will be<strong> {{Class.Teacher.FirstName}}&nbsp;{{Class.Teacher.LastName}}</strong>.</p>	<p>Your first session will be on&nbsp;<strong>{{Allocation.StartDate}}&nbsp;</strong>with your last session being on&nbsp;<strong>{{Allocation.EndDate}}.</strong></p>	<p>Kind regards,</p>	<p>Reception</p>','',0,NULL,1,1),(5,NULL,2,4,0,1,'New participant in your class','<p>Dear&nbsp;<strong>{{Class.Teacher.FirstName}}</strong></p>	<p><strong>{{Member.FirstName}}&nbsp;{{Member.LastName}}</strong> has joined the following Course/Class:</p>	<ul>	 <li>Centre:&nbsp;<strong>{{Centre.Name}}&nbsp;</strong>in the<strong>&nbsp;{{Centre.BookableArea}}</strong></li>	 <li>Course:&nbsp;<strong>{{Course.Name}} - {{Course.Description}}</strong></li>	 <li>Class:&nbsp;<strong>{{Class.Name}}</strong></li>	 <li>When:&nbsp;<strong>{{Class.Day}}</strong> at<strong>&nbsp;{{Class.Time}}</strong></li>	 <li>Size:&nbsp;<strong>{{Class.Size}}</strong></li>	</ul>	<p>Their first session will be&nbsp;<strong>{{Allocation.StartDate}}</strong>. They are booked in for&nbsp;<strong>{{Allocation.Sessions}} </strong>sessions.</p>	<p>Further details can be found by going to<strong>&nbsp;{{Coursepro.Address}}.</strong></p>	<p>Kind regards,</p>	<p>Reception</p>','',0,NULL,1,1),(6,NULL,1,5,0,1,'Confirmation of top up','<p>Dear&nbsp;<strong>{{Member.FirstName}}</strong></p>	<p>Your top up of&nbsp;<strong>{{Allocation.Sessions}} </strong>sessions for<strong>&nbsp;{{Class.Name}} </strong>on&nbsp;<strong>{{Class.Day}}</strong> at<strong>&nbsp;{{Class.Time}}&nbsp;</strong>has been successful.</p>	<p>Your new end date is&nbsp;<strong>{{Allocation.EndDate}}</strong>.</p>	<p>Kind regards,</p>	<p>Reception</p>','',0,NULL,1,1),(7,NULL,1,6,0,1,'Cancelled class','<p>Dear&nbsp;<strong>{{Member.FirstName}}</strong></p>	<p>Unfortunately we have had to cancel&nbsp;the following Class:</p>	<p><strong>{{Class.Name}}</strong> on<strong>&nbsp;{{Session.CancelledDate}}</strong>&nbsp;at&nbsp;<strong>{{Class.Time}}</strong></p>	<p>We will send out future reminders that the class(es) on <strong>{{Class.Cancelled}} </strong>has been cancelled and unfortunately is outside of our control.</p>	<p>Kind regards,</p>	<p>Reception</p>	<p>Our course records for&nbsp;<strong>{{Course.Name}} -&nbsp;{{Course.Description}}</strong>&nbsp;show that you have&nbsp;<strong>{{ClassMember.SessionsLeft}}</strong>&nbsp;sessions remaining in&nbsp;<strong>{{Class.Name}}</strong>&nbsp;on<strong>&nbsp;{{Class.Day}}</strong>&nbsp;at&nbsp;<strong>{{Class.Time}}</strong>.</p>	<p>You can also renew online at&nbsp;<strong>{{Homeportal.Address}}</strong>.</p>	<p>Kind regards,</p>	<p>Reception</p>','',0,NULL,1,1),(8,NULL,2,6,0,1,'Class Cancelled - Teacher Notification','<p>Dear&nbsp;<strong>{{Class.Teacher.FirstName}}</strong></p>	<p>Unfortunately we have had to cancel&nbsp;<strong>{{Class.Name}} </strong>on&nbsp;<strong>{{Session.CancelledDate}}</strong>&nbsp;at&nbsp;<strong>{{Class.Time}}</strong>.</p>	<p>Kind regards,</p>	<p>Reception</p>','',0,NULL,1,1),(9,NULL,1,7,0,1,'Ready to move - HomePortal','<p>Dear&nbsp;<strong>{{Member.FirstName}}</strong></p>	<p>You are now ready to move to&nbsp;<strong>{{Class.Name}}</strong>.</p>	<p>You can complete this movement online at:&nbsp;<strong>{{Homeportal.Address}}</strong></p>	<p>Kind regards,</p>	<p>Reception</p>	<p>&nbsp;</p>','',0,NULL,1,1),(10,NULL,1,8,0,1,'Movement Confirmation','<p>Dear&nbsp;<strong>{{Member.FirstName}}</strong></p>	<p>Thank you for selecting your new course.&nbsp;You are now enrolled on&nbsp;<strong>{{Class.Name}}</strong>&nbsp;on&nbsp;<strong>{{Class.Time}}</strong>,&nbsp;<strong>{{Class.Day}}</strong>&nbsp;at&nbsp;<strong>{{Centre.Name}}</strong>. This class will be with&nbsp;<strong>{{Class.Teacher.FirstName}} {{Class.Teacher.LastName}}</strong></p>	<p>Your last session on your current course (<strong>{{OldCourse.Name}} </strong>-<strong> {{OldClass.Name}} </strong>at&nbsp;<strong>{{OldClass.Time}}</strong>) will be&nbsp;<strong>{{OldAllocation.EndDate}}&nbsp;</strong>with&nbsp;<strong>{{OldClass.Teacher.FirstName}} {{OldClass.Teacher.LastName}}​</strong></p>	<p>Your first session on your new course will be&nbsp;<strong>{{Allocation.StartDate}}</strong>. See you then!</p>	<p>Kind regards,</p>	<p>Reception</p>','',0,NULL,1,1),(11,NULL,1,9,0,1,'Reminder - Tomorrow\'s class is cancelled','<p>Dear&nbsp;<strong>{{Member.FirstName}}</strong></p>	<p>Just to remind you that there is no&nbsp;<strong>{{Class.Name}} </strong>tomorrow (<strong>{{Session.CancelledDate}}</strong>)&nbsp;at&nbsp;<strong>{{Class.Time}}</strong>.</p>	<p>Kind regards,</p>	<p>Reception</p>	<p>&nbsp;</p>','',0,NULL,1,1),(12,NULL,1,10,0,1,'Reminder - Next week\'s class is cancelled','<p>Dear&nbsp;<strong>{{Member.FirstName}}</strong></p>	<p>Just to remind you that there is no<strong>&nbsp;{{Class.Name}} </strong>on&nbsp;<strong>{{Session.CancelledDate}}</strong> at<strong>&nbsp;{{Class.Time}}</strong>.</p>	<p>Kind regards,</p>	<p>Reception</p>','',0,NULL,1,1),(13,NULL,1,11,0,1,'Online Movement Confirmation','<p>Dear&nbsp;<strong>{{Member.FirstName}}</strong></p>	<p>Thank you for selecting your new course.&nbsp;You are now enrolled on&nbsp;<strong>{{Class.Name}}</strong>&nbsp;on&nbsp;<strong>{{Class.Time}}</strong>,&nbsp;<strong>{{Class.Day}}</strong>&nbsp;at&nbsp;<strong>{{Centre.Name}}</strong>. This class will be with&nbsp;<strong>{{Class.Teacher.FirstName}} {{Class.Teacher.LastName}}</strong></p>	<p>Your last session on your current course (<strong>{{OldCourse.Name}}&nbsp;</strong>-<strong>&nbsp;{{OldClass.Name}}&nbsp;</strong>at&nbsp;<strong>{{OldClass.Time}}</strong>) will be&nbsp;<strong>{{OldAllocation.EndDate}}&nbsp;</strong>with&nbsp;<strong>{{OldClass.Teacher.FirstName}} {{OldClass.Teacher.LastName}}​</strong></p>	<p>Your first session on your new course will be&nbsp;<strong>{{Allocation.StartDate}}</strong>. See you then!</p>	<p>Kind regards,</p>	<p>Reception</p>','',0,NULL,1,1),(14,NULL,1,12,0,1,'New Badge Awarded','<p>Congratulations&nbsp;<strong>{{Member.FirstName}}</strong></p>	<p>You&nbsp;have&nbsp;just&nbsp;been&nbsp;awarded&nbsp;your&nbsp;<strong>{{Badge.Name}}&nbsp;</strong>badge.&nbsp;This&nbsp;was&nbsp;awarded&nbsp;on&nbsp;<strong>{{Class.Name}} {{Class.Day}} {{Class.Time}}</strong>(<strong>{{Badge.AchieveDate}}</strong>).</p>	<p>Keep up the good work!</p>','',0,NULL,1,1),(15,NULL,2,13,0,1,'Payment Confirmation','<p>Dear&nbsp;<strong>{{Member.FirstName}}</strong>,</p>	<p>This is confirmation that we have taken a payment for&nbsp;<strong>{{Receipt.AmountPaid}} </strong>on&nbsp;<strong>{{Receipt.DateRaised}}​</strong>.</p>	<p>This transaction was for member ID<strong>&nbsp;{{Member.CardId}}</strong>. If this wasn&#39;t you then please contact us as soon as possible.</p>	<p>Kind regards,</p>	<p>Reception</p>','',0,NULL,1,1),(16,NULL,1,14,0,1,'Receipt not paid','<p>Dear <strong>{{Member.FirstName}}</strong>,</p>	<p>We have recently taken a booking for some swimming lessons (<strong>{{Receipt.DateRaised}}</strong>​)&nbsp;but the receipt for this has not been fully paid.</p>	<p>The transaction amount was for&nbsp;<strong>{{Receipt.AmountRaised}}</strong> and according to our records only&nbsp;<strong>{{Receipt.AmountPaid}}</strong> has been paid.</p>	<p>Please could you contact your local centre ASAP to arrange a payment for&nbsp;<strong>{{Receipt.AmountDue}}. </strong>Failure to do so may&nbsp;put you at risk of losing out on your booked space(s).</p>	<p><strong>{{Centre.Name}}</strong> can be reached by emailing&nbsp;<strong>{{Centre.EmailAddress}} </strong>or alternatively by calling <strong>{{Centre.TelephoneNumber}}</strong>. I you would like to visit the centre directly then we can be found at the following post code&nbsp;<strong>{{Centre.Postcode}}.</strong></p>	<p>Kind regards,</p>	<p>Reception</p>','',0,NULL,1,1),(17,NULL,1,15,0,1,'Thank you for swimming with us','<p>Dear&nbsp;<strong>{{Member.FirstName}}</strong></p>	<p>You have now left&nbsp;<strong>{{Class.Name}} </strong>.</p>	<p>If you would like to swim with us again then please contact us on using the following details otherwise we wish you all the best.</p>	<ol>	 <li><strong>{{Centre.EmailAddress}}</strong></li>	 <li><strong>{{Centre.TelephoneNumber}}</strong></li>	</ol>	<p>Kind regards,</p>	<p>Reception</p>','',0,NULL,1,1),(18,NULL,1,16,0,1,'Ready to move','<p>Hi</p>	<p><strong>{{Member.FirstName}}</strong> is now ready to move from&nbsp;<strong>{{Class.Name}} </strong>on<strong>&nbsp;{{Class.Day}}</strong> at&nbsp;<strong>{{Class.Time}}</strong>.</p>	<p>You can register online to do this at<strong>&nbsp;{{Homeportal.Address}}</strong>. Alternatively you can call us on <strong>{{Centre.TelephoneNumber}}</strong>&nbsp;or visit us in&nbsp;reception at&nbsp;<strong>{{Centre.Name}}.</strong></p>	<p>Kind regards,</p>	<p>Reception</p>	<p>&nbsp;</p>','',0,NULL,1,1),(19,NULL,1,17,0,1,'Removed from waiting list','<p>Dear&nbsp;<strong>{{Member.FirstName}}</strong></p>	<p>Please take this email as confirmation that you have now been removed from the waiting list for&nbsp;<strong>{{Course.Description}}</strong>&nbsp;at <strong>{{Waitinglist.Centres}}</strong>.</p>	<p>Kind regards,</p>	<p>Reception</p>','',0,NULL,1,1),(20,NULL,1,18,0,1,'Added to waiting list','<p>Hi <strong>{{Member.FirstName}}</strong></p>	<p>You have been added to the <strong>{{Member.Level.Name}}</strong>&nbsp;waiting list(s) at&nbsp;<strong>{{Waitinglist.Centres}}</strong> on the following days:</p>	<p><strong>{{Waitinglist.Days}}</strong></p>	<p>We will do our best to get you on your desired course as soon as possible.&nbsp;You are welcome to contact us at any time to follow up on this.</p>	<p>Kind regards,</p>	<p>Reception</p>','',0,NULL,1,1),(21,NULL,1,19,0,1,'Booked Online via DD','<p>Hi</p>	<p>Just to confirm that&nbsp;{<strong>{Member.FirstName}}&nbsp;{{Member.LastName}} </strong>has been re-enrolled into&nbsp;<strong>{{Class.Name}}</strong>.</p>	<p>Kind regards</p>','',0,NULL,1,1),(22,NULL,3,20,0,1,'Slot Booking Confirmation','<p>Hi,</p>	<p>You are receiving this email because <strong>{{Organisation.Name}} </strong>has been booked into a new swimming slot (<strong>{{Slot.NameCache}}</strong>)&nbsp;and&nbsp;you are&nbsp;listed as the main contact. The organisation details we have are as follows:</p>	<p>Email:<strong> {{Organisation.EmailAddress}}</strong></p>	<p>Tel:<strong> {{Organisation.TelephoneNumber}}</strong></p>	<p>Post Code:&nbsp;<strong>{{Organisation.Postcode}}</strong></p>	<p>The above organisation has been booked into our&nbsp;<strong>{{Slot.Name}} </strong>slot. This starts at&nbsp;<strong>{{Slot.Time}} </strong>on&nbsp;<strong>{{Slot.Day}}</strong>. These sessions will be taught by {<strong>{Slot.Teacher.FirstName}}&nbsp;{{Slot.Teacher.LastName}}&nbsp;</strong>and is available on&nbsp;the following day(s):</p>	<p><strong>&nbsp;{{Slot.Sessions}}</strong></p>	<p>Kind regards,</p>	<p>Reception</p>','',0,NULL,1,1),(23,NULL,1,21,0,1,'Re-enrolled','<p>Hi</p>	<p>Just to confirm that<strong>&nbsp;{{Member.FirstName}}&nbsp;{{Member.LastName}}</strong> has been re-enrolled into&nbsp;<strong>{{Class.Name}}</strong>.</p>	<p>Kind regards,</p>	<p>Reception</p>','',0,NULL,1,1),(24,NULL,1,22,0,1,'Confirmation of sign up on HomePortal','<p>Hi</p>	<p>Just to confirm that the following member(s) are&nbsp;now signed up on HomePortal. &nbsp;</p>	<p><strong>{{Homeportal.Members}}</strong></p>	<p>The registered email address is:&nbsp;<strong>{{Homeportal.EmailAddress}}</strong>.</p>	<p>You will be able to renew sessions online,&nbsp;move courses and review progress.</p>	<p>We have the following information on file for you. Please check this data and if you believe any of it is wrong then contact us at your earliest convenience:</p>	<ul>	 <li><strong>{{Member.CardId}} -&nbsp;{{Member.FirstName}}&nbsp;{{Member.LastName}}</strong> (<strong>{{Member.Age.Years}} </strong>years,&nbsp;<strong>{{Member.Age.Months}} </strong>months)</li>	 <li>Address 1: <strong>{{Member.Address1}}</strong></li>	 <li>Address 2:&nbsp;<strong>{{Member.Address2}}</strong></li>	 <li>Address 3: <strong>{{Member.Address3}}</strong></li>	 <li>County:&nbsp;<strong>{{Member.County}}</strong></li>	 <li>City:&nbsp;<strong>{{Member.City}}</strong></li>	 <li>Post Code:&nbsp;<strong>{{Member.Postcode}}</strong></li>	 <li>Email:&nbsp;<strong>{{Member.EmailAddresses}}</strong></li>	 <li>Mobile:&nbsp;<strong>{{Member.MobileNumber}}</strong></li>	</ul>	<p>Kind regards,</p>	<p>Reception</p>','',0,NULL,1,1);
